const handleGeminiATS = async () => {
  if (!parsedData || !jobDescription) return;

  try {
    const response = await axios.post("http://localhost:5000/ats-gemini", {
      resumeText: parsedData.text,
      jobText: jobDescription,
    });
    setAtsScore(response.data.ats_score);
    setSummary(response.data.summary);
    setMatchedKeywords(response.data.matched_keywords);
  } catch (err) {
    console.error("Gemini ATS Error:", err);
  }
};
